import { useState } from "react";

const Homepage = () => {
    const [name, setName] = useState("Jas");
    const [age, setAge] = useState(23);

    const handleClick = (e) => {
        setName("Jasarmiento");
        setAge(24);
    }

    return ( 
        <>
           <div className="home">
            <h2>Home Page</h2>
            <p>{name}, {age}</p>
            <button onClick={handleClick}>Click</button>
           </div>
        </> 
    );
}
 
export default Homepage;
